\begin{aligned} &\phantom{=(}(3(4)-2)(4(4)+1)-(3(4)-2)4(4)+1 \\ &= (12-2)(16+1)-(12-2)16+1 \\ &=(10)(17)-10(16)+1 \\ &= 170-160+1\\&=\boxed{11}.\end{aligned}
